import React from 'react';

import BComponent from './booking';
import Axios from 'axios';

const ldata = [
    {
      key: '1',
      date: '10/02/2020',
      time: '07:23',
      FlexibilityBefore: '00:30',
      FlexibilityAfter: '00:30',
    },
    {
      key: '2',
      date: '11/02/2020',
      time: '13:20',
      FlexibilityBefore: '00:15',
      FlexibilityAfter: '00:30',
    },
    {
      key: '3',
      date: '12/02/2020',
      time: '12:30',
      FlexibilityBefore: '01:30',
      FlexibilityAfter: '00:30',
    },
  ];

class BookingComponent extends React.Component {

    state = {
      array:[]
    }

    componentDidMount() {
      Axios.get('http://localhost:8000/api/booking/')
      .then(res => {
        this.setState({
          array: res.data
        });
        console.log(res.data);
      })
    }

    render() {
        return (
            <BComponent data={ldata}/>
        )
    }
}

export default BookingComponent;
